import React, { Component } from "react";
import { render } from "react-dom";
import { withScriptjs } from "react-google-maps";
import Map from "./components/Map.js";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import { Button } from 'react-bootstrap';
import AddPlaces from "./components/AddPlaces.js";
import { ProSidebar, Menu, MenuItem, SubMenu } from 'react-pro-sidebar';
import 'react-pro-sidebar/dist/css/styles.css';


class App extends Component {
  componentDidMount() {
    this.getData();
  }

  getData = () => {
    fetch("http://localhost:3000/users")
      .then((data) => data.json())
      .then((json) => console.log(json))
      .catch((err) => console.log(err));
  };

  render() {
    return (
      <div className="main">
        <MainMenu />
      </div>
    );
  }
}


function MainMenu() {
  return (
    <div className="asideMenu">
      <Router>
        <ProSidebar>
          <Menu iconShape="square">
            <MenuItem >Dashboard</MenuItem>
            <MenuItem><Link to="/Map">MapApp</Link></MenuItem>

            <MenuItem> <Link to="/AddPlaces">Add</Link></MenuItem>
          </Menu>
        </ProSidebar>

        {/* A <Switch> looks through its children <Route>s and
          renders the first one that matches the current URL. */}
        <Switch>
          <Route path="/Map">

            <MapApp />
          </Route>
          <Route path="/AddPlaces">
            <AddPlaces />
          </Route>
        </Switch>

      </Router>
    </div>

  );
}

function MapApp() {
  const MapLoader = withScriptjs(Map);
  return (
    <div className="App">
      <h3>Hello</h3>
      <MapLoader
        googleMapURL="https://maps.googleapis.com/maps/api/js?key=AIzaSyCTIuglr0yoyg7N3YinUj0xEeKmQCA8VT0"
        loadingElement={<div style={{ height: `100%` }} />}
      />
    </div>
  );
}

export default App;
